!function(){"use strict";document.querySelector(".open-menu").addEventListener("click",(()=>{document.querySelector(".aside").classList.add("aside_open"),document.querySelector("body").classList.add("body_overflow")})),document.querySelector(".close-menu").addEventListener("click",(()=>{document.querySelector(".aside").classList.remove("aside_open"),document.querySelector("body").classList.remove("body_overflow")}))}();